import React from 'react';
import Navbar from './Navbar';
import Home from './Home';


function App() {
  return (

    <>
    <Router>
      <Navbar />
      <Switch>
        <Route path='/' exact component={Home} />
        <Route path='/reports' component={Reports} />
        <Route path='/products' component={Products} />
      </Switch>
    </Router>
  </>


  );
}

export default App;
